pragma solidity 0.7.4;

import "./ERC20.sol";

contract MonbaseCoin is ERC20 {
    using SafeMath for uint256;

    uint256 public constant maxSupply = 200 * 10 ** 6 * 10 ** 18;

    constructor() {
        _initialize("MonbaseCoin", "MBC", 18, maxSupply);
    }

    function burn(uint256 amount) public {
        _burn(_msgSender(), amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        if (
            !whiteListBot[sender] && !whiteListBot[recipient] && antiBotEnabled
        ) {
            revert("Anti Bot");
        }
        if (
            limitSell == true &&
            dexPool[recipient] &&
            amount > _numTokensSellToAddToLiquidity
        ) {
            revert("Limit Sell Dex Pool");
        }

        super._transfer(sender, recipient, amount);
    }

    // receive eth from swap
    receive() external payable {}
}
